import { useState } from "react";
import "./App.css";
import ReCAPTCHA from "react-google-recaptcha";

function Login() {
  let captcha; // The reCAPTCHA instance.
  let captchaComplete = false;
  const onCaptchaChange = () => {
    console.log(captchaComplete);
    captchaComplete = true;
  };
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [loginDetails, setDetails] = useState({
    user: username,
    pass: password,
  });
  const handleUsernameChange = (e) => {
    setUsername(e.target.value);
  };
  const handlePasswordChange = (e) => {
    setPassword(e.target.value);
  };
  const forgotPassword = () => {
    let username = prompt("Enter your current username:");
  };
  const canSubmit = () => {
    if (!captchaComplete) {
      alert("Complete the reCAPTCHA below before logging in.");
    } else {
      setDetails({ ...loginDetails, user: username, pass: password });
      console.log("Your details are", loginDetails);
      alert("Logged In.");
    }
  };
  {
    /* Storing a reference to the reCAPTCHA instance so that we can interact with it,
    which we interact with when resetting it on a button click. */
  }
  const setCaptchaRef = (ref) => {
    if (ref) {
      return (captcha = ref);
    }
  };
  return (
    <div className="login">
      {/* Contains the login and password information. Allows user to type username and password.*/}
      <h1 className="login-title">Log In</h1>
      <p>Please enter your username and password.</p>
      <div className="form-input">
        <label>Username</label>
        <input type="text" id="username" onChange={handleUsernameChange} />
        <br></br>
        <label>Password</label>
        <input type="password" id="password" onChange={handlePasswordChange} />
      </div>
      <br></br>
      <br></br>
      {/* The container for people who've forgotten their password. */}
      <div className="remember-forgot">
        <div className="remember-me">
          <input type="checkbox" id="remember" />
          <label htmlFor="remember">Remember me</label>
        </div>
        <div className="forgot">
          <a href="#" onClick={forgotPassword}>
            Forgot password?
          </a>
        </div>
      </div>
      {/* Allows you to register as a new user. */}
      <div className="register">
        <span>
          Don't have an account?<a href="#">Register</a>
        </span>
      </div>
      {/* I'm not a robot button. */}
      <ReCAPTCHA
        sitekey="6LfteCMqAAAAAJ6jqBPL_UcBtXzQVhplPl8HT2xZ"
        onChange={onCaptchaChange}
        ref={(r) => setCaptchaRef(r)}
        className="captchabackground"
      />
      {/* Button for submitting and refreshing. */}
      <div id="buttons">
        <button id="submitButton" type="submit" onClick={canSubmit}>
          Submit
        </button>
        <button
          id="refreshButton"
          type="submit"
          onClick={() => captcha.reset()}
        >
          Refresh
        </button>
      </div>
    </div>
  );
}

export default Login;
